import React from 'react';
import Gallery from './Gallery';

let props = {
  imageUrl:"https://res.cloudinary.com/glide/image/fetch/f_auto,w_300,h_300,c_lfill/https%3A%2F%2Ffirebasestorage.googleapis.com%2Fv0%2Fb%2Fglide-prod.appspot.com%2Fo%2Ficon-images%252Fanonymous-e7fcf338-8a49-44d2-9fcb-afd802a823c8.png%3Falt%3Dmedia%26token%3D161e099a-1f69-426e-8633-ca4f70b80502",
  imageText:"image1",
  name: "Gallery"
  }

  function ShowStuff ({imageUrl, imageText}) {
    return(
  <div className="img-text">
  <img src={props.imageUrl}  alt=""/>
  <p >{props.imageText}</p>
  <p>{props.name}</p>
</div>

  );
}


export default ShowStuff;

